import React from "react";
import {StyleSheet, View} from "react-native";
import {Outlet, Link} from "react-router-dom";



class Pages extends React.Component {
    render() {
        return (<View style={styles.container}>
            <View style={styles.mainMenu}>
                <Link to="./" style={{
                    display: "block",
                    textAlign: "center",
                    textDecoration: "none",
                    backgroundColor: '#E3BCC1',
                    borderRadius: 4,
                    padding: "10px 20px",
                    color: '#3D0008'
                }}>Главная</Link>
                <Link to="./Price" style={{
                    display: "block",
                    textAlign: "center",
                    textDecoration: "none",
                    backgroundColor: '#E3BCC1',
                    borderRadius: 4,
                    padding: "10px 20px",
                    color: '#3D0008'
                }}>Цена</Link>
                <Link to="./Blog" style={{
                    display: "block",
                    textAlign: "center",
                    textDecoration: "none",
                    backgroundColor: '#E3BCC1',
                    borderRadius: 4,
                    padding: "10px 20px",
                    color: '#3D0008'
                }}>Блог</Link>
                <Link to="./Contacts" style={{
                    display: "block",
                    textAlign: "center",
                    textDecoration: "none",
                    backgroundColor: '#E3BCC1',
                    borderRadius: 4,
                    padding: "10px 20px",
                    color: '#3D0008'
                }}>Контакты</Link>
                <Link to="./Start" style={{
                    display: "block",
                    textAlign: "center",
                    textDecoration: "none",
                    backgroundColor: '#E3BCC1',
                    borderRadius: 4,
                    padding: "10px 20px",
                    color: '#3D0008'
                }}>Старт</Link>
            </View>
            <ThemeContext.Provider value={this.state.theme}>
                <Outlet/>
                <Toolbar changeTheme={this.toggleTheme} />
            </ThemeContext.Provider>
        </View>);
    }

    // constructor(props) {
    //     super(props);
    //     this.state = {
    //         theme: themes.light,
    //     };
    //
    //     this.toggleTheme = () => {
    //         this.setState(state => ({
    //             theme:
    //                 state.theme === themes.dark
    //                     ? themes.light
    //                     : themes.dark,
    //         }));
    //     };
    // }
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: 'rgb(61,0,8)',
        backgroundImage: 'linear-gradient(35deg, rgba(61,0,8,1) 35%, rgba(252,240,241,1) 100%)',
        color: '#FCF0F1',
        flex: 1,
        flexDirection: "column",
        justifyContent: "flex-start"

    }, button: {
        backgroundColor: '#E3BCC1', borderRadius: 4, paddingVertical: 10, paddingHorizontal: 20, color: '#3D0008'
    }, mainMenu: {
        flexDirection: "row", justifyContent: "center"
    }
});

function Toolbar(props) {
    return (
        <ThemedButton onClick={props.changeTheme}>
            Change Theme
        </ThemedButton>
    );
}


export default Pages;
